import { useState, useEffect } from 'react';
import { getItems } from './CartHelper';
import Card from './Card';
const Cart = () => {
    const [items,setItems] = useState([{}]);
    useEffect(() => {
      setItems(getItems())   
    },[])
    const showProductsInCart = () => {
            return(
                <div>
                    {JSON.stringify(items)}
                    <h2>Hello</h2>

                </div>
            );
    }
    return(
        <Layout title ="Cart Page" discreption = "Welcome to your Cart" className = "container-fluid">
            {showProductsInCart()}
            {JSON.stringify(items)}
    </Layout>
    );

}
export default Cart;
